import { BrowserRouter, Routes, Route } from "react-router-dom";

import Main from "./Main";
import Sub from "./Sub";

import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <mainheader>
        <nav>
          <ul>
            <li>main</li>
            <li>sub</li>
          </ul>
        </nav>
      </mainheader>
      <main>
        <Routes>
          <Route path="/main" element={<Main />}></Route>
          <Route path="/sub" element={<Sub />}></Route>
        </Routes>
      </main>
    </BrowserRouter>
  );
}

export default App;
